import image1 from '../Assets/city.jpg'
import image2 from '../Assets/black-whitecity.jpg'
// Add more imports as needed

// Define your image data
let data_product = [
  {
    id: 1,
    name: 'Big colored city',
    image:image1,
    new_price:700.00,
    old_price:1200.00,
  },
  {
    id: 2,
    name: 'A black and white city',
    image:image2,
    new_price:800.00,
    old_price:1200.00,
  },
  // Add more image objects as needed
];

export default data_product;
